{"url": "https://docs.python.org/3/tutorial/datastructures.html", "paragraph_number": 52, "snippet": "Another useful data type built into Python is the dictionary (seeMapping Types  dict). Dictionaries are sometimes found in other languages asassociative memories or associative arrays.  Unlike sequences, which areindexed by a range of numbers, dictionaries are indexed by keys, which can beany immutable type; strings and numbers can always be keys.  Tuples can be usedas keys if they contain only strings, numbers, or tuples; if a tuple containsany mutable object either directly or indirectly, it cannot be used as a key.You cant use lists as keys, since lists can be modified in place using indexassignments, slice assignments, or methods like append() andextend().", "subtitle": "Null", "title": "None", "image": "Null", "image_url": "Null", "type": null, "creationDate": 1616526541, "snippet_vector": [0.05539219453930855, -0.06337166577577591, 0.013800297863781452, 0.02113179862499237, -0.011073905043303967, 0.05997839942574501, -0.04300132021307945, -0.02353076823055744, -0.0631866455078125, 0.0629587173461914, -0.0017081237165257335, 0.05440104380249977, -0.05642188340425491, 0.0630277693271637, 0.04524316266179085, 0.06345771998167038, 0.019552579149603844, -0.019071219488978386, 0.05469641089439392, -0.02317429520189762, 0.04847554862499237, 0.03469597175717354, 0.026584669947624207, 0.04255285486578941, -0.05581088736653328, 0.018391406163573265, 0.03966876491904259, -0.033401042222976685, -0.03793587163090706, -0.057622116059064865, -0.008952461183071136, 0.052995048463344574, -0.06058092787861824, -0.061018869280815125, -0.030379049479961395, -0.060118407011032104, -0.051780231297016144, -0.022217286750674248, 0.04096820577979088, -0.05381162464618683, 0.04709542170166969, -0.037510327994823456, -0.04035114496946335, 0.032262492924928665, 0.0634516254067421, -0.031439732760190964, -0.04472091421484947, -0.04829388111829758, 0.06234787404537201, -0.04418476670980453