{"url": "https://docs.python.org/3/tutorial/datastructures.html", "paragraph_number": 74, "snippet": "Sequence objects typically may be compared to other objects with the same sequencetype. The comparison uses lexicographical ordering: first the first twoitems are compared, and if they differ this determines the outcome of thecomparison; if they are equal, the next two items are compared, and so on, untileither sequence is exhausted. If two items to be compared are themselvessequences of the same type, the lexicographical comparison is carried outrecursively.  If all items of two sequences compare equal, the sequences areconsidered equal. If one sequence is an initial sub-sequence of the other, theshorter sequence is the smaller (lesser) one.  Lexicographical ordering forstrings uses the Unicode code point number to order individual characters.Some examples of comparisons between sequences of the same type:", "subtitle": "Null", "title": "None", "image": "Null", "image_url": "Null", "type": null, "creationDate": 1616526541, "snippet_vector": [-0.0555504634976387, -0.06766939908266068, 0.057558320462703705, 0.06044367700815201, 0.057176150381565094, 0.04377766698598862, 0.05138620734214783, -0.04851376637816429, -0.0659840926527977, 0.06555735319852829, 0.017158759757876396, 0.05957919731736183, 0.009622651152312756, 0.06564564257860184, 0.04287859797477722, 0.06760245561599731, 0.03724869713187218, -0.02190818451344967, 0.0067418101243674755, 0.061182182282209396, 0.0018052353989332914, 0.014906726777553558, -0.045016370713710785, 0.04849385842680931, 0.050443924963474274, 0.0530046671628952, -0.021069826558232307, 0.06578411906957626, 0.04905126988887787, -0.0353243462741375, 0.06363283842802048, -0.04555653780698776, -0.0589827336370945, 0.018329771235585213, 0.054683998227119446, 0.03163731098175049, -0.022142823785543442, -0.03021678701043129, -0.05102469399571419, 0.006809297949075699, 0.036711785942316055, -0.0608222670853138, 0.017797065898776054, 0.038648281